
public class ControlFlow6 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int i;

		i = 100;

		switch (i / 10) {

		case 0:
		case 1:
		case 2:
		case 3:
		case 4:
		case 5:
		case 6:
			System.out.println("F");
			break;
		case 7:
			System.out.println("C");
			break;
		case 8:
			System.out.println("B");
			break;
		case 9:
		case 10:
			System.out.println("A");
			break;

		default:

		}

	}

}
